Бу форманы туһанан сиэрбэргэ билэлэри суруйуоххун сөп.
Урут суруллубут билэлэри көрөргө манна тиий: [[Special:FileList|билэлэр тиһиктэрэ]]. Билэлэри суруйуу уонна иккистээн суруйуу устуоруйата [[Special:Log/upload|манна]], сотуу устуоруйата [[Special:Log/delete|манна]] көстөллөр.

Билэни ыстатыйаҕа киллэрэргэ маннык суруйуллар:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> билэ хайдах баарынан (кыччаппакка);
**<strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|хос быһаарыы]]</nowiki></code></strong> 200 пииксэл кэтиттээх аллараа өттүгэр быһаарыы суруктаах экран хаҥас кырыытыгар сыстар ойуу;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> - ойууну бэйэтин көрдөрбөккө сигэтин эрэ көрдөрүү.
